import { MongoClient } from 'mongodb';

const DB_HOST = process.env.DB_HOST || 'localhost';
const DB_PORT = process.env.DB_PORT || 27017;
const DB_DATABASE = process.env.DB_DATABASE || 'files_manager';
const url = `mongodb://${DB_HOST}:${DB_PORT}/${DB_DATABASE}`;

class DBClient {
  constructor() {
    console.log('MongoDB Connection String:', url);
    MongoClient.connect(`${url}`, { useUnifiedTopology: true }, (err, client) => {
      if (!err) {
	this.db = client.db(DB_DATABASE);
        this.users = this.db.collection('users');
	this.files = this.db.collection('files');
      } else {
	console.log(`Error: ${err}`);
	this.db = false;
      }
    });
  }

  isAlive() {
    return Boolean(this.db);
  }

  async nbUsers() {
    try {
      // await this.client.connect();
      // const users = this.client.db().collection('users');
      const numDocs = this.users.countDocuments();
      return numDocs;
    } catch (err) {
      console.log(`Error returning number: ${err}`);
    }
  }

  async nbFiles() {
    // await this.client.connect();
    // const files = this.client.db().collection('files');
    const numFiles = this.files.countDocuments();
    return numFiles;
  }
}

const dbClient = new DBClient();

export default dbClient;

